import React from 'react';
import {NavLink} from 'react-router-dom'

const Menu = ()=>{
    return(
        <>
            <a href="/">Home</a><br/>
            <a href="/about">About</a><br/>
            <a href="/user">User</a>
            <NavLink to="/"></NavLink>
        </>
    );
}

export default Menu;
